/* AGENT_SHEET */
@charset "UTF-8";
@namespace html url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://userstyles.org") , url-prefix("https://userstyles.org") {
html {background: white repeat-x !important; background-image: url("https://lh5.googleusercontent.com/-9mPfq_bTK4o/T4qBmWVF8eI/AAAAAAAAAMQ/ZojfswVTVrQ/I/backgrnd777.jpg"),url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAIAAAAVCAYAAABsZT8HAAAAAXNSR0IArs4c6QAAAAZiS0dEAP8A/wD/oL2nkwAAAAlwSFlzAAANsAAADbABfWVZ+gAAAAd0SU1FB9oGAxEqHfMNphEAAAA5SURBVAjXY2SQUvnPwMDAwMLAyMQAYTAwQhmMDAwMDIzIUoyMOBkMmFIk6SJCMYxRH+rKwMDAwAAAGzcCz5PMGZsAAAAASUVORK5CYII=") !important; background-position: center 21px,0 0 !important; overflow-y: scroll !important;}
body {background: none transparent !important; font-family: sans-serif !important; /* margin: 0 0 0 5px !important; padding: 0 !important;*/ margin-top: 26px !important; max-width: none !important; min-width: 860px !important;}

body>header {position: absolute !important; top: 0 !important; left: 0 !important; padding: 0 8px !important; background: none transparent !important;}
body>header,body>header a,body>header h1 {font-size: 11px !important; font-family:tahoma,verdana,arial,sans-serif,Lucida Sans !important; color: #ccc !important; line-height: 21px !important; text-decoration: none !important;}
body>header a:hover {color: white !important; text-decoration: none !important;}

header,article,nav,section,footer,figure,#screenshots {background: none transparent !important;}
#ads,.ad,#post-install-ad,#below-install-ad {display: none !important;}

a {color: #334 !important;}
a:hover {color: #333 !important;}
h2 {font-style: normal !important;}
h1,h2 {font-size: 16px !important; font-variant: normal !important;}
a,b,h1,div,p,h2,h3 {font-size: 13px !important; color:black !important;}
input,textarea,select,button {-moz-appearance: none !important; margin-bottom: 1px !important; font-size: 12px !important; border: 1px solid #A6A697 !important; background: rgba(255,255,255,0.5) !important;}
input[type="file"] input[type="button"] {margin: 0 5px !important;}
input[type="image"] {vertical-align: middle !important;}
select>* {border: 0 none !important;}
section>h2 {margin: 0 !important;}

#install,pre,#search,.install-status {background: rgba(255,255,255,0.6) !important; border: 1px solid #A6A697 !important;}

#discussions {padding: 0 0 0 20px !important;}
#discussions li {list-style-image: none !important;list-style-type: none !important; background: transparent left center no-repeat !important; padding: 0 0 1px 20px !important;}
.good-average-rating,.ok-average-rating,.bad-average-rating,.no-average-rating {padding: 8px !important; margin: -3px 0 !important; width: 0 !important; height: 0 !important;}
#discussions .good-rating,.good-average-rating {background-image: url("data:image/png;base64,") !important;}
#discussions .ok-rating,.ok-average-rating {background-image: url("data:image/png;base64,") !important;}
#discussions .no-rating,.no-average-rating {background-image: url("data:image/png;base64,") !important;}
#discussions .bad-rating,.bad-average-rating {background-image: url("data:image/png;base64,") !important;}
#average-rating img {width: 0 !important; height: 0 !important; vertical-align: middle !important; padding: 8px !important; background: transparent url("data:image/png;base64,") 0 0 no-repeat !important;}
#average-rating .ok-average-rating {background-position: 0 -16px !important;}
#average-rating .bad-average-rating {background-position: 0 -32px !important;}

#style-info,#additional-info,#discussions-area {margin: 0 388px 0 0 !important; padding: 0 0 10px !important; clear: left !important;}
#style-info {padding: 30px 0 /*20px*/ 10px !important;}
#main-style-info {margin: 0 !important; padding: 0 !important;}

#info-tables {float: none !important; padding: 0 !important; margin: 0 !important; position: absolute !important; top: 31px !important;}
#info-tables * {display: inline-block !important; margin: 0 !important;}
#info-tables img {vertical-align: middle !important;}
#info-tables th {display: none !important;}
#info-tables td:before {content: "[" !important;}
#info-tables td:after {content: "]" !important;}

.more {font-size: inherit !important; border: 0 none !important;}
#related li {border: 0 none !important; margin: 0 0 3px !important;}

#overlay {width: 100% !important; height: 100% !important; position: fixed !important;}
#content-wrapper {float: none !important; width: auto !important;}
#left-sidebar {margin: 0 !important; float: none !important; position: absolute !important; top: 26px !important; left: 0 !important; bottom: auto !important; right: auto !important;}

.screenshot {border: 1px solid rgba(0,0,0,0.2) !important;}
#screenshots {border-radius: 0 !important; padding: 0 !important; border: 0 none !important;}
figure {overflow: visible !important; max-height: none !important;}
#left-info {margin: 0 2em 1em !important; float: right !important; width: auto !important; overflow: visible !important;}
.style-brief {vertical-align: top !important; padding: 10px 0 !important; margin: 0 !important; clear: both !important;}
.style-brief-text {margin: 0 0 0 130px !important;}
.style-brief p {margin: 0 0 2px !important; display: inline !important;}
.style-brief header a {font-size: 14px !important; font-weight: bold !important;}
.style-brief .screenshot {width: auto !important; height: auto !important; max-width: 120px !important; max-height: 100px !important;}
.listing-left-info  {width: auto !important; min-height: 0 !important; float: left !important;}
.listing-no-screenshot {display: none !important;}

/*.author-styles*/ #main-article > table tr td {background: #eee !important; padding: 0 2px !important; border: 1px #ccc solid !important; margin: 0 !important;}
/*.author-styles*/ #main-article > table {border-spacing: 0 !important; border-collapse: collapse !important; font-size: 11px !important;}
/*.author-styles*/ #main-article > table tr th {border: 1px #A6A697  solid !important; background: none rgba(255,255,255,0.4) !important}
/*.author-styles*/ #main-article > table tr:nth-child(even) td {background: white !important;}

#obsoletion-message {padding-top: 30px !important;}
#show-code {margin: 5px 0 0 !important; font-family: monospace !important;}
#donate input[type="image"] {width: 0 !important; height: 0 !important; border: 0 none !important; display: inline-block !important; padding: 13px 120px 0 0 !important; background: transparent url("data:image/png;base64,") no-repeat 0 0 !important;}
}
